  display = props => {
    var singleTodoItem,
      todoArray = [];
    for (
      singleTodoItem = 0;
      singleTodoItem < this.props.array.length;
      singleTodoItem++
    ) {
      console.log(this.props.array[singleTodoItem]);
      var msg = this.props.array[singleTodoItem].msg;
      console.log(msg);
      var singleListItem = (
        <div>
          {" "}
          <TodolistItem todoListMsg={msg} />{" "}
        </div>
      );
      console.log("this value from todolistitem");
      console.log(singleListItem);
      todoArray.push(singleListItem);
    }
    console.log(todoArray);
    return todoArray;
  };

  render() {
    return <div>{this.display()}</div>;
  }
}

export default Todolist;
